import Icontext from "../components/shared/icontext";
import LoggedinContainer from "../containers/Loggedincontainers";

const Searchpage = () => {
    return (
        <LoggedinContainer currentactivescreen="search">
            <div className="w-full py-6 ">
                <div className="w-1/3 p-3 px-5 text-sm rounded-full bg-gray-900 flex text-white items-center">
                    <div>
                        <Icontext iconName="zondicons:search" className="text-xs" />
                    </div>
                    <input
                    type="text"
                    placeholder="What Do you want to listen?"
                    className="w-full bg-gray-900"
                 />
                 </div>

            </div>
        </LoggedinContainer>
    );
}

export default Searchpage;
